let state = {
    message: {
        dialogsData: [
            {id: 1, name: "Dimych",},
            {id: 2, name: "Evgeniy",},
            {id: 3, name: "Sasha",},
        ],
        messagesData: [
            {id: 1, message: "Hello",},
            {id: 2, message: "How are you?",},
            {id: 3, message: "Chel",},
        ],
    },
    postsData: [
        {name: 'Evgeniy', text: 'I need more React', like:'16'},
        {text: 'I love REACT!!!', like:'45'}
    ],
};

export default state;
